INSERT INTO `cpm_poc` (`poc_id`, `info`, `email`) VALUES
(22, '<h1 id=\"firstHeading\" lang=\"en\" style=\"text-align: center;\"><i>Strait Jacket</i></h1><div class=\"medium-insert-images\"><figure contenteditable=\"false\">\r\n    <img src=\"data:image/png;base64,\" alt=\"\">\r\n        \r\n</figure></div><p class=\"\" style=\"text-align: justify;\"><i><b>Strait Jacket</b></i> (ストレイト・ジャケット<sup><a href=\"https://en.wikipedia.org/wiki/Help:Installing_Japanese_character_sets\" title=\"Help:Installing Japanese character sets\">?</a></sup> <i>Sutoreito Jaketto</i>) is a <a href=\"https://en.wikipedia.org/wiki/Light_novel\" title=\"Light novel\">light novel</a> series by <a href=\"https://en.wikipedia.org/wiki/Ichir%C5%8D_Sakaki\" title=\"Ichirō Sakaki\">Ichirō Sakaki</a> with illustrations by Yō Fujishiro, published by <a href=\"https://en.wikipedia.org/wiki/Fujimi_Shobo\" title=\"Fujimi Shobo\">Fujimi Shobo</a> under their <a href=\"https://en.wikipedia.org/wiki/Fujimi_Fantasia_Bunko\" title=\"Fujimi Fantasia Bunko\">Fujimi Fantasia Bunko</a> imprint. It was published in 11 volumes between 2000 and 2010. The series was adapted into a 3-episode OVA series in 2007. A film version of the OVA aired in the <a href=\"https://en.wikipedia.org/wiki/United_States\" title=\"United States\">United States</a> on the <a href=\"https://en.wikipedia.org/wiki/Syfy\" title=\"Syfy\">Syfy</a> channel.<i><br></i></p><p class=\"\" style=\"text-align: justify;\"><br></p><p style=\"text-align: justify;\"><i>Strait Jacket</i> is set an <a href=\"https://en.wikipedia.org/wiki/Alternate_history\" title=\"Alternate history\">alternate history</a> where magic was proven to exist in the year 1899. The use of sorcery spread throughout all facets of society and changed the social and technological development of the world. The location is Tristan, an <a href=\"https://en.wikipedia.org/wiki/Urban_area\" title=\"Urban area\">urban</a> <a href=\"https://en.wikipedia.org/wiki/Metropolis\" title=\"Metropolis\">metropolis</a> that appears to be an amalgamation at the turn of the 20th century <a href=\"https://en.wikipedia.org/wiki/Tokyo\" title=\"Tokyo\">Tokyo</a>, <a href=\"https://en.wikipedia.org/wiki/San_Francisco\" title=\"San Francisco\">San Francisco</a>, and <a href=\"https://en.wikipedia.org/wiki/Victorian_era\" title=\"Victorian era\">Victorian era</a> <a href=\"https://en.wikipedia.org/wiki/London\" title=\"London\">London</a>.</p><p style=\"text-align: justify;\">Alongside this technology and science exists <a href=\"https://en.wikipedia.org/wiki/Magic_(fantasy)\" title=\"Magic (fantasy)\">magic</a>, which has been proven possible in public demonstrations by Dr. George Greco. Although the use of magic is only possible for a few talented individuals, it is very dangerous and highly illegal. Due to an invisible contaminant called the \"malediction\", or simply the \"<a href=\"https://en.wikipedia.org/wiki/Curse\" title=\"Curse\">curse</a>\", people who use magic too often are at risk in transforming into \"<a href=\"https://en.wikipedia.org/wiki/Demon\" title=\"Demon\">Demons</a>,\" or horrific, malevolent abominations of nature that become immune to ordinary weapons. The Magic Administration Bureau, also known as the <a href=\"https://en.wikipedia.org/wiki/Magic_(paranormal)\" title=\"Magic (paranormal)\">Sorcery</a> Management Bureau, is set up in the attempt to safely explore the nature of magic, officially document it, attempt to provide rational scientific explanation for it, regulate its use and police those who use magic illegally. Magic, utilized in a safe sense by the Bureau, has been used as a viable energy source by the civil service, industry, agriculture, medicine, and the military. Effectively, the Magic Administration Bureau is now in control of every field and every facet of society.</p><div class=\"medium-insert-buttons\" contenteditable=\"false\" style=\"left: 718px; top: 521.66px; display: none;\" data-active-addon=\"images\">\r\n    <button class=\"medium-insert-buttons-show\" type=\"button\"><span>+</span></button>\r\n    <ul class=\"medium-insert-buttons-addons\" style=\"display: none;\">\r\n            <li style=\"display: inline-block;\"><button data-addon=\"images\" data-action=\"add\" class=\"medium-insert-action\" type=\"button\"><span class=\"fa fa-camera\"></span></button></li>\r\n            <li style=\"display: none;\"><button data-addon=\"embeds\" data-action=\"add\" class=\"medium-insert-action\" type=\"button\"><span><img src=\"img/embed.png\"></span></button></li>\r\n    </ul>\r\n</div>', 's@gmail.com');
